// YourBotArmy.js
import React from 'react';

const YourBotArmy = ({ enlistedBots = [], onDelete }) => {
  const handleDelete = (botId) => {
    setEnlistedBots((prevEnlistedBots) =>
      prevEnlistedBots.filter((bot) => bot.id !== botId)
    );

    fetch(`/api/bots/${botId}`, {
      method: 'DELETE',
    })
      .then((response) => response.json())
      .then((data) => {
        if (data.success) {
          onDelete(botId);
        }
      })
      .catch((error) => {
        console.error('Error deleting bot:', error);
      });
  };

  return (
    <div className="your-bot-army">
      <h3>Your Bot Army</h3>
      {enlistedBots.length === 0 ? (
        <p>Your bot army is empty.</p>
      ) : (
        enlistedBots.map((bot) => (
          <div key={bot.id} className="bot-card">
            {/* ...Other bot information... */}
            <button onClick={() => handleDelete(bot.id)}>Delete</button>
          </div>
        ))
      )}
    </div>
  );
};

export default YourBotArmy;
